CKEDITOR.plugins.setLang("a11yhelp","gl",{title:"Instruci\xf3ns de accesibilidade",contents:"Axuda. Para pechar este di\xe1logo prema ESC.",legend:[{name:"Xeral",items:[{name:"Barra de ferramentas do editor",legend:"Prema ${toolbarFocus} para navegar pola barra de ferramentas. Para moverse polos distintos grupos de ferramentas use as teclas TAB e MAI\xdaS+TAB. Para moverse polas distintas ferramentas use FRECHA DEREITA ou FRECHA ESQUERDA. Prema ESPAZO ou INTRO para activar o bot\xf3n da barra de ferramentas."},{name:"Editor de di\xe1logo",legend:"Dentro dun cadro de di\xe1logo, prema a tecla TAB para desprazarse ao campo seguinte do cadro de di\xe1logo, prema MAI\xdaS + TAB para desprazarse ao campo anterior, prema INTRO para presentar o cadro de di\xe1logo, prema a tecla ESC para cancelar o di\xe1logo. Para os di\xe1logos que te\xf1en varias p\xe1xinas, prema ALT + F10 para navegar \xe1 lapela da lista. Despois pasar \xe1 seguinte lapela con TAB ou FRECHA DEREITA. Para ir \xe1 lapela anterior con SHIFT + TAB ou FRECHA ESQUERDA. Prema ESPAZO ou INTRO para seleccionar a lapela da p\xe1xina."},{name:"Editor do men\xfa contextual",legend:"Prema ${contextMenu} ou a TECLA MEN\xda para abrir o men\xfa contextual. A seguir m\xf3vase \xe1 seguinte opci\xf3n do men\xfa con TAB ou FRECHA ABAIXO. M\xf3vase \xe1 opci\xf3n anterior con MAI\xdaS + TAB ou FRECHA ARRIBA. Prema ESPAZO ou INTRO para seleccionar a opci\xf3n do men\xfa. Abra o submen\xfa da opci\xf3n actual con ESPAZO ou INTRO ou FRECHA DEREITA. Regrese ao elemento principal do men\xfa con ESC ou FRECHA ESQUERDA. Peche o men\xfa contextual con ESC."},{name:"Lista do editor",legend:"Dentro dunha lista, m\xf3vase ao seguinte elemento da lista con TAB ou FRECHA ABAIXO. M\xf3vase ao elemento anterior da lista con MAI\xdaS + TAB ou FRECHA ARRIBA. Prema ESPAZO ou INTRO para escoller a opci\xf3n da lista. Prema ESC para pechar a lista."},{name:"Barra da ruta ao elemento no editor",legend:"Prema ${elementsPathFocus} para navegar ata os elementos da barra de ruta. M\xf3vase ao seguinte elemento bot\xf3n con TAB ou FRECHA DEREITA. M\xf3vase ao bot\xf3n anterior con MAI\xdaS + TAB ou FRECHA ESQUERDA. Prema ESPAZO ou INTRO para seleccionar o elemento no editor."}]},{name:"Ordes",items:[{name:"Orde \xabdesfacer\xbb",legend:"Prema ${undo}"},{name:"Orde \xabrefacer\xbb",legend:"Prema ${redo}"},{name:"Orde \xabnegra\xbb",legend:"Prema ${bold}"},{name:"Orde \xabcursiva\xbb",legend:"Prema ${italic}"},{name:"Orde \xabsubli\xf1ar\xbb",legend:"Prema ${underline}"},{name:"Orde \xabligaz\xf3n\xbb",legend:"Prema ${link}"},{name:"Orde \xabcontraer a barra de ferramentas\xbb",legend:"Prema ${toolbarCollapse}"},{name:"Orde \xabacceder ao anterior espazo en foco\xbb",legend:"Prema ${accessPreviousSpace} para acceder ao espazo m\xe1is pr\xf3ximo de foco inalcanz\xe1bel anterior ao cursor, por exemplo: dous elementos HR adxacentes. Repita a combinaci\xf3n de teclas para chegar a espazos de foco distantes."},{name:"Orde \xabacceder ao seguinte espazo en foco\xbb",legend:"Prema ${accessNextSpace} para acceder ao espazo m\xe1is pr\xf3ximo de foco inalcanz\xe1bel posterior ao cursor, por exemplo: dous elementos HR adxacentes. Repita a combinaci\xf3n de teclas para chegar a espazos de foco distantes."},{name:"Axuda da accesibilidade",legend:"Prema ${a11yHelp}"}]}],backspace:"Backspace",tab:"Tab",enter:"Enter",shift:"Shift",ctrl:"Ctrl",alt:"Alt",pause:"Pause",capslock:"Caps Lock",escape:"Escape",pageUp:"Page Up",pageDown:"Page Down",end:"End",home:"Home",leftArrow:"Left Arrow",upArrow:"Up Arrow",rightArrow:"Right Arrow",downArrow:"Down Arrow",insert:"Insert","delete":"Delete",leftWindowKey:"Left Windows key",rightWindowKey:"Right Windows key",selectKey:"Select key",numpad0:"Numpad 0",numpad1:"Numpad 1",numpad2:"Numpad 2",numpad3:"Numpad 3",numpad4:"Numpad 4",numpad5:"Numpad 5",numpad6:"Numpad 6",numpad7:"Numpad 7",numpad8:"Numpad 8",numpad9:"Numpad 9",multiply:"Multiply",add:"Add",subtract:"Subtract",decimalPoint:"Decimal Point",divide:"Divide",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"Semicolon",equalSign:"Equal Sign",comma:"Comma",dash:"Dash",period:"Period",forwardSlash:"Forward Slash",graveAccent:"Grave Accent",openBracket:"Open Bracket",backSlash:"Backslash",closeBracket:"Close Bracket",singleQuote:"Single Quote"});